kyle = nil;

function Load(m)
	map = m;
	map.run_forever = false;
	dialogue_supervisor = map.dialogue_supervisor;
	event_supervisor = map.event_supervisor;

	local sprite;
	local dialogue;
	local event;
	local chest;
	local text;

	-- Create the player's sprite
	sprite = ConstructSprite("Claudius", 1000, 25, 7);
	map:AddGroundObject(sprite);
	-- Set the camera to focus on the player''s sprite
	map:SetCamera(sprite);

	-- Add Kyle sprite
	kyle = ConstructSprite("Kyle", 2, 5, 75, 0.0, 0.0);

	-- Dialogue with kyle
	dialogue = hoa_map.MapDialogue(1);

	text = hoa_utils.Translate("There you are!");
	dialogue:AddText(text, 1000, 1, 0, false);
	text = hoa_utils.Translate("Hey...");
	dialogue:AddText(text, 2, 2, 0, false);
	text = hoa_utils.Translate("What are you doing? The captain wants to speak with you.");
	dialogue:AddText(text, 1000, 3, 0, false);
	text = hoa_utils.Translate("He can wait.");
	dialogue:AddText(text, 2, 4, 0, false);
	text = hoa_utils.Translate("...What?");
	dialogue:AddText(text, 1000, 5, 0, false);
	text = hoa_utils.Translate("(Kyle hands Claudius a cloth.  Inside is a piece of cake.");
	dialogue:AddText(text, 2, 6, 0, false);
	text = hoa_utils.Translate("I managed to swipe some goodies from the kitchen quarters a bit ago.  I saved you some.");
	dialogue:AddText(text, 2, 7, 0, false);
	text = hoa_utils.Translate("You shouldn't -");
	dialogue:AddText(text, 1000, 8, 0, false);
	text = hoa_utils.Translate("It's just a piece of cake.  It's not going to hurt anyone.");
	dialogue:AddText(text, 2, 9, 0, false);
	text = hoa_utils.Translate("I guess you're right.  And hey, thanks for covering for me back there.  I appreciate it.");
	dialogue:AddText(text, 1000, 10, 0, false);
	text = hoa_utils.Translate("Don't mention it.  I'm already on bad terms with the captain anyway; there's no sense in getting you in trouble too.");
	dialogue:AddText(text, 2, 11, 0, false);
	text = hoa_utils.Translate("Hey, what's that... look out!");
	dialogue:AddText(text, 1000, -1, 2, false);

	kyle:AddDialogueReference(1);
	dialogue_supervisor:AddDialogue(dialogue);

	if (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("kyle_missing") == true) then
		if (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("desert_beast_fought") == false) then
			map:AddGroundObject(kyle);
		end
	end

	dialogue = hoa_map.MapDialogue(2);

 	text = hoa_utils.Translate("Good job.");
	dialogue:AddText(text, 1000, 1, 0, false);
 	text = hoa_utils.Translate("Let's go back to our living quarters.");
	dialogue:AddText(text, 2, 2, 0, false);
 	text = hoa_utils.Translate("All right.");
	dialogue:AddText(text, 1000, 3, 0, false);
 	text = hoa_utils.Translate("Claudius?");
	dialogue:AddText(text, 2, 4, 0, false);
 	text = hoa_utils.Translate("Yes?");
	dialogue:AddText(text, 1000, 5, 0, false);
 	text = hoa_utils.Translate("I just want you to know that no matter what happens, well always be friends.");
	dialogue:AddText(text, 2, -1, 0, false);

	dialogue_supervisor:AddDialogue(dialogue);

	-- Create an EnemyZone (2000 ms between respawns, monsters restricted to zone area)
	local ezone = hoa_map.EnemyZone(2000, true);
	ezone:AddSection(hoa_map.ZoneSection(34, 88, 46, 96));

	-- Create a sprite representation of a monster attached to this zone
--	sprite = ConstructEnemySprite("Slime", map.object_supervisor:GenerateObjectID(), 5, 5);
	

--	sprite = ConstructEnemySprite("Scorpion", map.object_supervisor:GenerateObjectID(), 10, 10);
--	sprite = ConstructEnemySprite("Snake", map.object_supervisor:GenerateObjectID(), 15, 15);

	local enemy = hoa_map.EnemySprite();
	enemy:SetObjectID(map.object_supervisor:GenerateObjectID());
	enemy:SetContext(1);
	enemy:SetCollHalfWidth(1.0);
	enemy:SetCollHeight(2.0);
	enemy:SetImgHalfWidth(1.0);
	enemy:SetImgHeight(4.0);
	enemy:SetMovementSpeed(hoa_map.MapMode.SLOW_SPEED);
	enemy:LoadStandardAnimations("img/sprites/map/scorpion_walk.png");
	enemy:NewEnemyParty();
	enemy:AddEnemy(5);
	enemy:AddEnemy(2);
	enemy:NewEnemyParty();
	enemy:AddEnemy(5);
	enemy:AddEnemy(5);
	enemy:SetBattleBackground("img/backdrops/battle/desert.png");
	-- Add the enemy to the zone two times (it also gets added to the ground objects) 
	ezone:AddEnemy(enemy, map, 2);

	-- Finally, add the zone to the map
	map:AddZone(ezone);



	-- Create an EnemyZone
	ezone = hoa_map.EnemyZone(2000, true); -- 2000 ms between respawns, monsters restricted to zone area
	ezone:AddSection(hoa_map.ZoneSection(54, 45, 66, 60)); -- define zone boundaries
