	enemy:SetObjectID(map.object_supervisor:GenerateObjectID());
	enemy:SetContext(1);
	enemy:SetCollHalfWidth(1.0);
	enemy:SetCollHeight(2.0);
	enemy:SetImgHalfWidth(1.0);
	enemy:SetImgHeight(4.0);
	enemy:SetMovementSpeed(hoa_map.MapMode.SLOW_SPEED);
	enemy:LoadStandardAnimations("img/sprites/map/snake_walk.png"); -- enemy party will appear on map as snake
	enemy:NewEnemyParty(); -- First potential enemy party
	enemy:AddEnemy(3); -- add a snake
	enemy:AddEnemy(2); -- add a spider
	enemy:NewEnemyParty(); -- Second potential enemy party
	enemy:AddEnemy(3); -- add a snake
	enemy:AddEnemy(3); -- add a snake
	enemy:SetBattleBackground("img/backdrops/battle/desert.png");
	ezone:AddEnemy(enemy, map, 2); -- Add the enemy to the zone two times	
	map:AddZone(ezone); -- Finally, add the zone to the map

	-- Create an EnemyZone
	ezone = hoa_map.EnemyZone(2000, true); -- 2000 ms between respawns, monsters restricted to zone area
	ezone:AddSection(hoa_map.ZoneSection(44, 30, 56, 45)); -- define zone boundaries
	local enemy = hoa_map.EnemySprite();
	enemy:SetObjectID(map.object_supervisor:GenerateObjectID());
	enemy:SetContext(1);
	enemy:SetCollHalfWidth(1.0);
	enemy:SetCollHeight(2.0);
	enemy:SetImgHalfWidth(1.0);
	enemy:SetImgHeight(4.0);
	enemy:SetMovementSpeed(hoa_map.MapMode.SLOW_SPEED);
	enemy:LoadStandardAnimations("img/sprites/map/snake_walk.png"); -- enemy party will appear on map as snake
	enemy:NewEnemyParty(); -- First potential enemy party
	enemy:AddEnemy(3); -- add a snake
	enemy:AddEnemy(2); -- add a spider
	enemy:NewEnemyParty(); -- Second potential enemy party
	enemy:AddEnemy(3); -- add a snake
	enemy:AddEnemy(3); -- add a snake
	enemy:SetBattleBackground("img/backdrops/battle/desert.png");
	ezone:AddEnemy(enemy, map, 2); -- Add the enemy to the zone two times	
	map:AddZone(ezone); -- Finally, add the zone to the map


	-- Create a zone for exiting the map, to be used as a trigger
	exit_zone = hoa_map.MapZone();
	exit_zone:AddSection(hoa_map.ZoneSection(0, 0, 58, 3));
	map:AddZone(exit_zone);

	-- Register event functions
	event = hoa_map.ScriptedEvent(2, 2, 0);
	event_supervisor:RegisterEvent(event);

	event = hoa_map.BattleEncounterEvent(11000, 103);
	event:SetMusic("mus/The_Creature_Awakens.ogg");
	event:SetBackground("img/backdrops/battle/desert.png");
	event:AddEventLink(11001, false, 0);
	event_supervisor:RegisterEvent(event);
	event = hoa_map.DialogueEvent(11001, 2);
	event_supervisor:RegisterEvent(event);
	
	event = hoa_map.MapTransitionEvent(22111, "dat/maps/desert_training.lua");
	event_supervisor:RegisterEvent(event);
end


function Update()
	-- Check if the map camera is in the exit zone
	if (exit_zone:IsInsideZone(map.camera.x_position, map.camera.y_position) == true) then
		if (event_supervisor:IsEventActive(22111) == false) then
			event_supervisor:StartEvent(22111);
		end
	end
end

map_functions[1] = function()
end

map_functions[2] = function()
	-- Adds Kyle to the party and removes his sprite from the map
	GlobalManager:GetEventGroup("kyle_story"):AddNewEvent("desert_beast_fought", 1);
	GlobalManager:AddCharacter(KYLE);

	kyle:SetContext(2);
	kyle:SetVisible(false);
	kyle:SetNoCollision(true);
	kyle:SetUpdatable(false);

	-- starts boss encounter
	event_supervisor:StartEvent(11000);
end
